    static function getInstance($params = array()) {
		if (is_null(self::$instances)) {
			$instance = new self($params);
			$instance->params->use_ajax = 0;
			self::$instances = $instance;
		}

		return self::$instances;
	}

	function filterAllowValue($data, $decode=false){
		if (is_array($data)) {
			foreach($data as $key=>$value){
				$key = intval($key);
				if (is_array($value)){
					$trackBar = in_array($key, $this->params->show_characteristics_5);
					foreach($value as $k=>$v){
						$k = intval($k);
						if ($decode) {
							$v = urldecode($v);
						}
						if (($this->allProductExtraField[$key]->type == 1 && $v != '') || $v) {
							if (!$trackBar) {
								$data[$key][$k] = $decode ? "'".$this->db->escape($v)."'" : $v;
							}
						} else if (!$trackBar) {
							unset($data[$key][$k]);
						}
					}
				}
			}
		}
		
		return $data;
	}

	function getCountProducts() {
		static $countProducts;

		if (!isset($countProducts)) {
			if ($this->json) {
				$countProducts = $this->json->total;
			} else {
				$this->db->setQuery(
					'SELECT COUNT(DISTINCT prod.product_id) FROM `#__jshopping_products` AS prod'
					.$this->join
					.$this->where
				);
				$countProducts = $this->db->loadResult();
			}
		}

		return $countProducts;
	}

	function getDisplayPrices($advQuery='') {
		if (!$this->_setPricesParams()) {
			return;
		}

		$this->db->setQuery(
			'SELECT 
			'.$this->priceRange->select.'
			FROM `#__jshopping_products` AS prod
			'.$this->join.'
			LEFT JOIN `#__jshopping_currencies` AS cr ON prod.currency_id = cr.currency_id
			'.$this->priceRange->join.'
			'.$this->where.'
			'.$advQuery
		);
		$row = $this->db->loadObject();
		$this->priceRange->from = $row->prod_price_min;
		$this->priceRange->to = $row->prod_price_max;
		if ($this->jshopConfig->product_list_show_min_price){
			if ($row->min_price_min !== null && $row->min_price_min < $row->prod_price_min) {
				$this->priceRange->from = $row->min_price_min;
			}
			if ($row->min_price_max !== null && $row->min_price_max > $row->prod_price_max) {
				$this->priceRange->to = $row->min_price_max;
			}
		}
		if ($this->params->attributes_prices) {
			if ($row->attr_price_min !== null && (float)$row->attr_price_min < $row->prod_price_min) {
				$this->priceRange->from = (float)$row->attr_price_min;
			}
			if ($row->attr_price_max !== null && (float)$row->attr_price_max > $row->prod_price_max) {
				$this->priceRange->to = (float)$row->attr_price_max;
			}
		}
		$percentageDiscount = 1 - $this->userShop->percent_discount / 100;
		$this->priceRange->from = floor($this->priceRange->from * $this->jshopConfig->currency_value * $percentageDiscount);
		$this->priceRange->to = ceil($this->priceRange->to * $this->jshopConfig->currency_value * $percentageDiscount);
	}

	function getSubCategories($category_id) {
		static $subCategories;

		if (!isset($subCategories)) {
			$subCategories = $this->_getSubCategories($category_id);
			if (count($subCategories)) {
				$subCategories[] = $category_id;
			}
		}

		return $subCategories;
	}

	function getDisplayCategorys($order_by='name') {
		static $displayCategorys;

		if (!isset($displayCategorys)) {
			$displayCategorys = array();
		}

		if (!isset($displayCategorys[$order_by])) {
			$displayCategorys[$order_by] = array();
		
			if (count($this->subCategoryies)) {
				$this->db->setQuery(
					'SELECT DISTINCT cat.category_parent_id AS parent_id, cat.ordering as ordering, cat.category_id AS id, cat.`'.$this->lang->get('name').'` AS name, cat.`'.$this->lang->get('short_description').'` AS short_desc
					FROM `#__jshopping_products` AS prod
					LEFT JOIN `#__jshopping_products_to_categories` AS pr_cat USING (product_id)
					LEFT JOIN `#__jshopping_categories` AS cat USING (category_id)
					WHERE prod.product_publish = 1 AND prod.access IN ('.$this->groups.')
					AND cat.access IN ('.$this->groups.') AND cat.category_publish = 1
					AND pr_cat.category_id IN ('.implode(',',$this->subCategoryies).')
					ORDER BY name'
				);

				$displayCategorys[$order_by] = $this->db->loadObjectList('id');
			} else if ($this->type != 'category') {
				$this->db->setQuery(
					'SELECT DISTINCT cat.category_parent_id AS parent_id, cat.ordering as ordering, cat.category_id AS id, cat.`'.$this->lang->get('name').'` AS name, cat.`'.$this->lang->get('short_description').'` AS short_desc
					FROM `#__jshopping_products` AS prod
					'.$this->join.'
					'.$this->where.'
					AND cat.category_id > 0
					ORDER BY name'
				);

				$displayCategorys[$order_by] = $this->db->loadObjectList('id');
			}
			
			if ($order_by == 'ordering') {
				$this->minCategoryLevel = PHP_INT_MAX;
				$this->db->setQuery(
					'SELECT category_id, category_parent_id FROM `#__jshopping_categories`
					ORDER BY category_parent_id, ordering'
				);
				$all_cats = $this->db->loadObjectList();
				$categories = array();
				if (count($all_cats)){
					foreach($all_cats as $key=>$category){
						if (!$category->category_parent_id){
							recurseTree($category, 0, $all_cats, $categories, 0);
						}
					}
				}
				foreach ($categories as $key=>$category) {
					if (isset($displayCategorys[$order_by][$category->category_id])) {
						if ($category->level < $this->minCategoryLevel) {
							$this->minCategoryLevel = $category->level;
						}
						$displayCategorys[$order_by][$category->category_id]->level = $category->level;
						$categories[$key] = $displayCategorys[$order_by][$category->category_id];
					} else {
						unset($categories[$key]);
					}
				}
				$displayCategorys[$order_by] = $categories;
			}
		}

		return $displayCategorys[$order_by];
	}

