	function getDisplayAttributes() {
		static $displayAttributes;
		static $allAttributes;
		static $allAttributeValues;

		if (!isset($displayAttributes)) {
			$displayAttributes = $displayAttributeValues = array();
			$allAttributes = JTable::getInstance('Attribut', 'jshop')->getAllAttributes();
			$allAttributeValues = JTable::getInstance('AttributValue', 'jshop')->getAllAttributeValues(2);
			$this->db->setQuery(
				'SELECT a.attr_id, a.attr_value_id FROM `#__jshopping_products_attr2` AS a
				LEFT JOIN `#__jshopping_products` AS prod USING(product_id)
				'.$this->join.'
				'.$this->where.'
				GROUP BY a.attr_value_id'
			);
			$rows = $this->db->loadObjectList();
			foreach ($rows as $attr) {
				if (!in_array($attr->attr_id, $this->params->attributes_id) && $attr->attr_value_id) {
					$displayAttributeValues[$attr->attr_value_id] = $attr->attr_value_id;
				}
			}
			$select = '';
			foreach($allAttributes as $attr){
				if (!in_array($attr->attr_id, $this->params->attributes_id) && $attr->independent==0) {
					$select .= 'attr_'.$attr->attr_id.' AS `'.$attr->attr_id.'`, ';
				}
			}
			if ($select != '') {
				$select = substr($select,0,strlen($select)-2);
			}
			if ($select) {
				if ($this->jshopConfig->hide_product_not_avaible_stock){
					$this->attr_where = ' AND a.count > 0';
				} else {
					$this->attr_where = '';
				}
				$this->db->setQuery(
					'SELECT DISTINCT '.$select.' FROM `#__jshopping_products_attr` AS a
					LEFT JOIN `#__jshopping_products` AS prod USING(product_id)
					'.$this->join.'
					'.$this->where.'
					'.$this->attr_where
				);
				$rows = $this->db->loadAssocList();
				foreach ($rows as $row) {
					foreach ($row as $v) {
						if ($v) {
							$displayAttributeValues[$v] = $v;
						}
					}
				}
			}
			foreach ($allAttributeValues as $attributeValue) {
				if (!in_array($attributeValue->value_id,$displayAttributeValues)) continue;
				$displayAttributes[$attributeValue->attr_id][] = $attributeValue;
			}
		}

		$this->allAttributes = $allAttributes;
		$this->allAttributeValues = $allAttributeValues;

		if ($this->params->sort_attributes == 'name') {
			foreach ($displayAttributes as $id=>$rows) {
				$tmpArr = $tmpRows = array();
				foreach ($rows as $key=>$row) {
					$tmpArr[] = $row->name;
				}
				natsort($tmpArr);
				foreach ($tmpArr as $key=>$row) {
					$tmpRows[] = $rows[$key];
				}
				$displayAttributes[$id] = $tmpRows;
			}
		}

		echo'<pre>';print_r( $displayAttributes );echo'</pre>'.__FILE__.' '.__LINE__;
		die(__FILE__ .' '. __LINE__ );



		return $displayAttributes;
	}

	function getDisplayCharacteristics() {
		static $displayCharacteristics;
		static $allProductExtraField;
		static $allProductExtraFieldValueDetail;
		static $trackbarExtraField;

		if (!isset($displayCharacteristics)) {
			$allProductExtraField = JSFactory::getAllProductExtraField();
			$allProductExtraFieldValueDetail = JSFactory::getAllProductExtraFieldValueDetail();
			$displayCharacteristics = $trackbarExtraField = array();
			foreach ($this->params->show_characteristics_5 as $characteristic_id) {
				$trackbarExtraField[$characteristic_id] = array();
			}
			$select = '';
			foreach ($allProductExtraField as $extraField) {
				if (in_array($extraField->id, $this->params->characteristics_id)) {
					$select .= 'extra_field_'.$extraField->id.' AS `'.$extraField->id.'`, ';
					$displayCharacteristics[$extraField->id] = array();
				}
			}
			if ($select != '') {
				$select = substr($select,0,strlen($select)-2);
			}
			if ($select) {
				$this->db->setQuery(
					'SELECT DISTINCT '.$select.' FROM `#__jshopping_products` AS prod
					'.$this->join.'
					'.$this->where
				);
				$rows = $this->db->loadAssocList();
				foreach ($rows as $row) {
					foreach ($row as $k=>$v) {
						if ($allProductExtraField[$k]->type == 1) {
							$displayCharacteristics[$k][] = $v;
							if (isset($trackbarExtraField[$k]) && $v) {
								$trackbarExtraField[$k][$v] = $v;
							}
						} else {
							$v_arr = explode(',', $v);
							foreach ($v_arr as $val) {
								if (isset($allProductExtraFieldValueDetail[$k][$val])) {
									$displayCharacteristics[$k][] = $val;
									if (isset($trackbarExtraField[$k])) {
										$trackbarExtraField[$k][$val] = $allProductExtraFieldValueDetail[$k][$val];
									}
								}
							}
						}
					}
				}
			}
			foreach ($displayCharacteristics as $k=>$v) {
				if (count($v)) {
					$displayCharacteristics[$k] = array_unique($v);
				} else {
					unset($displayCharacteristics[$k]);
				}
			}
		}
		$this->allProductExtraField = $allProductExtraField;
		$this->allProductExtraFieldValueDetail = $allProductExtraFieldValueDetail;
		$this->trackbarExtraField = $trackbarExtraField;

		return $displayCharacteristics;
	}

	function getEnableAvailability($advQuery='') {
		if ($this->params->hide_non_active != 2) {
			$this->db->setQuery(
				'SELECT MIN(prod.product_quantity) as min, MAX(prod.product_quantity) as max
				FROM `#__jshopping_products` AS prod'
				.$this->join
				.$this->where
				.$advQuery
			);
			$raw = $this->db->loadObject();
			$enableAvailability = array('0');
			if ($raw->max > 0) {
				$enableAvailability[] = '1';
			}
			if ($raw->min == 0) {
				$enableAvailability[] = '2';
			}
		} else {
			$enableAvailability = array('0','1','2');
		}

		return $enableAvailability;
	}

