	private function _getSubCategories($category_id) {
		static $subCategories;
		static $categoryList;

		if (!isset($categoryList)) {
			$categoryList = $subCategories = array();
			$allCategories = JTable::getInstance('Category', 'jshop')->getAllCategories();
			foreach ($allCategories as $row) {
				$categoryList[$row->category_parent_id][] = $row->category_id;
			}
		}

		if (isset($categoryList[$category_id])) {
			foreach ($categoryList[$category_id] as $subcategory_id) {
				$subCategories[] = $subcategory_id;
				$this->_getSubCategories($subcategory_id);
			}
		}

		return $subCategories;
	}

	private function _setPricesParams() {
		if (isset($this->priceRange)) {
			return true;
		}

		$this->priceRange = new stdClass;
		$this->priceRange->from = 0;
		$this->priceRange->to = 0;

		if ($this->jshopConfig->displayprice == 2 && !$this->user->id) {
			return false;
		}

		if ($this->jshopConfig->display_price_admin == $this->jshopConfig->display_price_front) {
			$this->priceRange->join = ' ';
			$selectTax = '';
		} else {
			$this->priceRange->join = ' LEFT JOIN `#__jshopping_taxes` AS tax ON prod.product_tax_id = tax.tax_id';
			if ($this->jshopConfig->display_price_admin) {
				$selectTax = ' * ';
			} else {
				$selectTax = ' / ';
			}
			$selectTax .= '(1 + tax.tax_value / 100)';
		}
		$this->priceRange->select = ' MIN(prod.product_price / cr.currency_value'.$selectTax.') AS prod_price_min, MAX(prod.product_price / cr.currency_value'.$selectTax.') AS prod_price_max';
		if ($this->jshopConfig->product_list_show_min_price){
			$this->priceRange->select .= ' , MIN(prod.min_price / cr.currency_value'.$selectTax.') AS min_price_min, MAX(prod.min_price / cr.currency_value'.$selectTax.') AS min_price_max';
		}
		if ($this->params->attributes_prices) {
			$this->priceRange->join .= ' LEFT JOIN `#__jshopping_products_attr` as attr ON prod.product_id = attr.product_id';
			$this->priceRange->select .= ' , MIN(attr.price / cr.currency_value'.$selectTax.') AS attr_price_min, MAX(attr.price / cr.currency_value'.$selectTax.') AS attr_price_max';
		}

		return true;
	}

